    function changeSort() {
        var x = document.getElementById(""myDIV"");
        if (x.innerHTML === ""⇧"") {
            x.innerHTML = ""⇩"";
        } else {
            x.innerHTML = ""⇧"";
        }
    }

    function searchLevels() {
        var query = document.getElementById(""input"").value;
        var sort = document.getElementById(""dropdwn"").value;
